package parser

import (
	"fmt"
	"strings"
	"testing"

	"github.com/shopspring/decimal"
)

func TestNonce(t *testing.T) {

	var tests = []struct {
		input  any
		expect any
	}{
		{"1111", 1111},
		{1111, 1111},
		{1111.111, 1111.111},
		{"1111.111", 1111.111},
		{"-1111.111", -1111.1111},
		{"1.0.1", 111},
		{"-1.0.1", 111},
	}

	for i, test := range tests {
		v, err := decimal.NewFromString(strings.TrimSpace(fmt.Sprintf("%v", test.input)))
		if err != nil {
			t.Fatal(i, err)
		}

		if v.IntPart() != test.expect {
			t.Fatal("The result is not as expected", i, v, test.expect)
		}

	}

}

